{"Plan":"1) Determine who is your biggest opponent (i.e. candidate with most support)

2) Hire a time of people with a variety of qualities (verbal skills, social media skills, computer skills, etc)

3) Use this team to sabotage all events hosted by your opponent. Possibles ideas include: having people react badly or make rude comments on social media postings, have people rip down flyers, have people attend the rallys and cause disruptions, hack opponents website, etc. "}

{"Plan":"Since light is typically a staple for Christmas trees and helps the visual as well as the spectacle of the tree, a substitute needs to be used.  Without direct light, reflective surfaces should be used.  Colored foil placed in spiky patterns regularly around the tree will make the tree reflect natural light spectacularly, and will even give a unique visual depending on what kind of lighting is used.  Without using lights, one could use flames far enough away from the tree to be safe that will then reflect off of the foil.  

Without using Christmas decorations, you still need something to view within the tree.  Christmas is a time of good feeling and coming together with family, so pictures of people from around the world with their families and extended families could cover the tree, and could even be strategically placed to show the diversity of families around the world.  Children's toys can also be added for some color, and then donated to needy families on Christmas Day if they are still in good condition.

A tree topper is also typical of a Christmas tree, so in lieu of actual Christmas decorations, something impressive would need to reside there.  A disco ball would be a very impressive look, although in its typical spherical form it would look strange.  A special spiky version could be custom-ordered to act as the star atop the tree, which would also reflect the lighting brilliantly."}
